import React from 'react';
import styled from 'styled-components';
import img from './image5.png';
import Banner from '../Banner';

const HeroCont = styled.div`
height: 967px;
width: 573px;
border-radius: 0px;
background: url(${img});
justify-content: in-flex;
`;

const BannerComp = styled.div`
    position: fi;   
    right: 0%;
    bottom: 10%;
`;

const Hero = ({}) => {
    return <HeroCont>
        <BannerComp><Banner></Banner></BannerComp>
    </HeroCont>
}

export default Hero;
